  const [jobs, setJobs] = useState([]);
  const [errors, setErrors] = useState("");

  useEffect(() => {
    axios
      .get("127.0.0.1:1111/api/v1/job-listings/")
      .then((response) => {
        setJobs(response.data);
      }).catch((error) => {
        setErrors(error.message);

